import './App.css';

const App = () => {

  return(
    <div className="App">
      <div className = "nav-bar">
        <a href = "#about-me!"> about me! </a>
        <a href = "#my-interests"> my interests </a>
        <a href = "my-current-projects"> my current projects </a>
        <a href = "my-future-plans"> my future plans </a>
      </div>
      <div id = "about-me!">
        <h2> This is a new division </h2>
      </div>
    </div>
  );
}
export default App;
